import './App.css';

function App() {
  return (
    <div className="App" class="">
      <h1>Hello World! This is gonna be a Boat Game!</h1>
      <div class="d-flex justify-content-center">
        <div className='col-6 d-flex flex-column'>
          <label class="text-center">Movie Name</label>
          <input type='text' name='movieName' class="mt-1"/>
          <label class="text-center mt-3" >Movie Review</label>
          <input class="" type='text' name='movieReview' class="mt-1"></input>
        </div>
      </div>
      <button class="text-center">Submit</button>
    </div>
  );
}

export default App;
